import {StyleSheet, StatusBar} from "react-native"

export default StyleSheet.create({
      header: {
        width: '90%',
        height: '15%',
        borderBottomWidth: 2,
        justifyContent: "space-between",
        alignItems: 'center',
        flexDirection: 'row'
      },
      image:{
        width: 150,
        resizeMode: 'contain'
      },
      card: {
        width: "70%",
        height: 100,
        backgroundColor: '#f5f5f5',
        alignItems: 'center',
        justifyContent: "center",
        alignSelf: "center",
        margin: "10%",
        borderRadius: 5,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 12,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        elevation: 24
      },
      title:{
        fontSize: 18
      },
      scrollview: {
        width: "100%",
      },
})
